import React from "react";

export default function Layout() {
  return (
    <AppBar position="sticky">
      <Toolbar sx={{ width: "640px", m: "auto" }}>
        <Typography variant="h4" align="center">
          Quiz App
        </Typography>
      </Toolbar>
    </AppBar>
  );
}
